import pandas as pd
from matplotlib import pyplot as plt
import numpy as np
from sklearn.mixture import GaussianMixture
from collections import defaultdict
from scipy import integrate as scin

def read_cgs(file_path):
    with open(file_path, "r") as file:
        lines = [line.strip() for line in file]
    return lines

def load(gse):
    file_path = f"trash/multipeak_cgs_GSE111629.no_chrx.only_cgs.txt"
    cgs = read_cgs(file_path)
    file_path = f"new_gse_test/{gse}_normalized_celltype.csv"
    df = pd.read_csv(file_path)
    df.index = df['Unnamed: 0']
    df = df.drop(columns=['Unnamed: 0'])
    fit_cgs = list(set(df.index).intersection(cgs))
    new_df = df.loc[fit_cgs]
    return [fit_cgs,new_df]

def better_gap(cgs,df):
    for cg in cgs:
        range_count = range_count(cg,df)
        range_count.sort_values()[:3]

def Extract(lst,i):
    return [item[i] for item in lst]
def gauss_mode_graph(X,cg,gse):
    X = np.array([[l] for l in X])
    # fit models with 1-10 components
    N = np.arange(1, 4)
    models = [None for i in range(len(N))]

    for i in range(len(N)):
        models[i] = GaussianMixture(N[i]).fit(X)

    # compute the AIC and the BIC
    AIC = [m.aic(X) for m in models]
    BIC = [m.bic(X) for m in models]

    M_best = models[np.argmin(AIC)]

    x = np.linspace(0, 1, 1000)
    logprob = M_best.score_samples(x.reshape(-1, 1))
    responsibilities = M_best.predict_proba(x.reshape(-1, 1))
    pdf = np.exp(logprob)
    pdf_individual = responsibilities * pdf[:, np.newaxis]

    temp_dict = defaultdict()
    if (len(pdf_individual[0]) > 2):
        temp_dict['peak_1'], temp_dict['peak_2'], temp_dict['peak_3'] = Extract(pdf_individual, 0)*x, Extract(
            pdf_individual, 1)*x, Extract(pdf_individual, 2)*x
    elif (len(pdf_individual[0]) > 1):
        temp_dict['peak_1'], temp_dict['peak_2'], temp_dict['peak_3'] = Extract(pdf_individual, 0)*x, Extract(
            pdf_individual, 1)*x, len(pdf_individual) * [-1]
    else:
        temp_dict['peak_1'], temp_dict['peak_2'], temp_dict['peak_3'] = Extract(pdf_individual, 0)*x, len(
            pdf_individual) * [-1], len(pdf_individual) * [-1]

    res = stats_out(temp_dict)
    # calculate intersections between all three combination of the peaks
    #r0,r1,r2 = # boolean array for each intersection between the peaks
    b_array = [intersect(temp_dict['peak_1'],temp_dict['peak_2']), intersect(temp_dict['peak_2'], temp_dict['peak_3']),intersect(temp_dict['peak_1'], temp_dict['peak_3'])]

    # one peak senerio
    # 2 or more intersections over 0.01 integration value
    if(sum(b_array)>1):
        peaks = 1
    # two peak senerio
    # at least one intersections over 0.01 as a first threashold (eventually it will be wise to calculate the best threashold - ML?)
    elif(sum(b_array)>0):
        peaks = 2
    # 3 peak senerio
    # no intersections over 0.01
    else:
        peaks = 3

    plot_fit(res, peaks, X,x, pdf_individual, cg, gse)

    return peaks

def plot_fit(res,peaks,X,x,pdf_individual,cg,gse):
    fig = plt.figure(figsize=(10, 10))
    # fig.subplots_adjust(left=0.12, right=0.97,
    #                    bottom=0.21, top=0.9, wspace=0.5)

    # plot 1: data + best-fit mixture
    ax = fig.add_subplot()

    plt.title(f"number of peaks: {peaks}")

    ax.hist(X, 30, density=True, histtype='stepfilled', alpha=0.4)
    ax.plot(x, pdf_individual, '--k')

    ax.text(0.04, 0.96, "Best-fit Mixture",
            ha='left', va='top', transform=ax.transAxes)
    ax.set_xlabel('$x$')
    ax.set_ylabel('$p(x)$')

    fig = ax.figure
    fig.savefig(f"{cg}_{gse}_gauss.png")
    plt.clf()
    plt.close(fig)

def solve(m1,m2,std1,std2):
  a = 1/(2*std1**2) - 1/(2*std2**2)
  b = m2/(std2**2) - m1/(std1**2)
  c = m1**2 /(2*std1**2) - m2**2 / (2*std2**2) - np.log(std2/std1)
  return np.roots([a,b,c])

def gauss(x,mean,sigma):
    point = (1/(sigma*np.sqrt(2*np.pi)))*np.e**((-1/2)*((x-mean)/sigma)**2)
    return point
def intersect(pdf1,pdf2):
    # Define the range over which to calculate the intersection
    # all the range
    pdf1,pdf2 = np.array(pdf1), np.array(pdf2)
    roots = solve(pdf1.mean(),pdf2.mean(),pdf1.std(),pdf2.std())

    x_max = max(pdf1)
    x_min = min(pdf1)

    if(len(roots)>2):
        print("thefcuk?")
    elif(len(roots)==2):
        x_max = max(roots)
        x_min = min(roots)
    elif(len(roots)==1):
        if(roots>pdf1.mean()):
            x_min = roots
        else:
            x_max = roots
    else:
        print("thefuck?")

    x_min = 0 if x_min<0 else x_min
    # integration of the area under the curve that is mutual to pdf1 and pdf2
    intersection, error = scin.quad(lambda x: gauss(x,pdf1.mean(),pdf1.std()), x_min, x_max)
    intersection_tot, error = scin.quad(lambda x:  gauss(x,pdf1.mean(),pdf1.std()), min(pdf1), max(pdf1))

    print("*"*50)
    print(f"{intersection=}")
    print(f"{intersection_tot=}")
    print("percentage of intersection:", intersection/intersection_tot)
    print(f" {pdf1.mean()=}, {pdf2.mean()=}")
    print(f"{pdf1.std()=}, {pdf2.std()=}")
    print("*" * 20)

    if (intersection>0.01):
        return True
    else:
        return False
def gauss_mode(X):
    X = np.array([[l] for l in X])
    # fit models with 1-10 components
    N = np.arange(1, 4)
    models = [None for i in range(len(N))]

    for i in range(len(N)):
        models[i] = GaussianMixture(N[i]).fit(X)

    # compute the AIC and the BIC
    AIC = [m.aic(X) for m in models]
    BIC = [m.bic(X) for m in models]

    M_best = models[np.argmin(AIC)]

    x = np.linspace(0, 1, 1000)
    logprob = M_best.score_samples(x.reshape(-1, 1))
    responsibilities = M_best.predict_proba(x.reshape(-1, 1))
    pdf = np.exp(logprob)
    pdf_individual = responsibilities * pdf[:, np.newaxis]

    temp_dict = defaultdict()
    if (len(pdf_individual[0]) > 2):
        temp_dict['peak_1'], temp_dict['peak_2'], temp_dict['peak_3'] = Extract(pdf_individual, 0) * x, Extract(
            pdf_individual, 1) * x, Extract(pdf_individual, 2) * x
    elif (len(pdf_individual[0]) > 1):
        temp_dict['peak_1'], temp_dict['peak_2'], temp_dict['peak_3'] = Extract(pdf_individual, 0) * x, Extract(
            pdf_individual, 1) * x, len(pdf_individual) * [None]
    else:
        temp_dict['peak_1'], temp_dict['peak_2'], temp_dict['peak_3'] = Extract(pdf_individual, 0) * x, len(
            pdf_individual) * [None], len(pdf_individual) * [None]

    res = stats_out(temp_dict)

    return res

def stats_out(pdf_dict):
    res = defaultdict()
    peaks_list = ["peak_1","peak_2","peak_3"]
    for peaks in peaks_list:
        res[peaks] = defaultdict()
        l = pdf_dict[peaks]
        if l[0] == None:
            res[peaks]['mean'] = None
            res[peaks]['std'] = None
            res[peaks]['max'] = None
            res[peaks]['sum'] = None
            res[peaks]['median'] = None
        else:
            pdf_beta_val  = np.array(l)
            assert True == (np.any((pdf_beta_val <= 1)|(pdf_beta_val >= 0 ))), "Beta values are out of range (0-1)"

            res[peaks]['mean'] = np.array(l).mean()
            res[peaks]['std'] = np.array(l).std()
            res[peaks]['max'] = np.array(l).max()
            res[peaks]['sum'] = np.array(l).sum()
            res[peaks]['median'] = np.median(np.array(l))

    return res

def gup_hunt(cgs,df):
    new_df = pd.DataFrame()
    for cg in cgs:
        new_df[cg] = df.loc[cg].sort_values().diff()

    mask = new_df > 0.16
    mask = mask.sum()
    mask_3 = mask[mask > 1].index.to_list()
    mask_2 = mask[mask == 1].index.to_list()

    return [mask_2, mask_3]

def range_count(df,cg):
    working_df = df.loc[cg]
    new_pd = pd.DataFrame({
        'range': pd.cut(working_df, np.arange(0, 1, 0.01)),
        'val': working_df,
        'index': working_df.index,
        'counter': [1] * len(working_df)
    })

    range_count = new_pd.groupby('range')['counter'].count()
    return range_count

def barplot_range_count(df,group,cgs):
    # cgs = df.index.to_li
    # st()[:len(df) - 4]
    for cg in cgs:
        range_count = range_count(df,cg)

        ax = range_count.plot.bar(rot=90,figsize=(15,10))
        fig = ax.figure
        fig.savefig(f"{cg}_{group}_barh.png")
        plt.clf()
        plt.close(fig)


def peak_table():
    gse = "GSE111629"
    cgs_temp, df = load(gse)
    cgs = df.index.intersection(cgs_temp)

    df_dict = defaultdict()
    df_dict['id'] = cgs

    peaks = ["peak_1", "peak_2", "peak_3"]

    for pik in peaks:
        df_dict[f'{pik}_mean'] = []
        df_dict[f'{pik}_std'] = []
        df_dict[f'{pik}_max'] = []
        df_dict[f'{pik}_sum'] = []
        df_dict[f'{pik}_median'] = []

    for cg in cgs:
        X = df.loc[cg]
        res = gauss_mode(X)
        peaks = ["peak_1", "peak_2", "peak_3"]

        for pik in peaks:
            df_dict[f'{pik}_mean'].append(res[pik]['mean'])
            df_dict[f'{pik}_std'].append(res[pik]['std'])
            df_dict[f'{pik}_max'].append(res[pik]['max'])
            df_dict[f'{pik}_sum'].append(res[pik]['sum'])
            df_dict[f'{pik}_median'].append(res[pik]['median'])

    new_df = pd.DataFrame(df_dict)
    new_df.index = new_df['id']
    new_df.to_csv('GSE111629_gauss.csv')

